import React from "react";

function Card(card, props) {
  function handleClick() {
    props.onCardClick(props.card);
  }
  return (
    <div className="elements__element">
      <img className="elements__image" alt={card.name} 
           src={card.link} onClick={handleClick}/>
        <div class="elements__info">
          <h2 className="elements__name">{card.name}</h2>
          <div class="elements__like-container">
            <button type="button" class="elements__like"></button>
            <p class="elements__likes-amount">{card.likes.length}</p>
          </div>
        </div>
        <button type="button" class="elements__delete"></button>
    </div>
  );
}

export default Card;
